import React from 'react'
import "./dirilisepisodes.css"
import ReactPlayer from 'react-player'
import { Carddirilis } from '../Carddirilis/Carddiriliss';


export const DrirlisEpisode1 = () => {

   return (
      <div>
      <div className='videocop'>
          <ReactPlayer url='https://youtu.be/5fJXATpIiUQ' controls playing={true} muted width="1080px" height="720px" onEnded
          />
      </div>
      <div>
        <Carddirilis />
      </div>
      </div>
    )
  };

  export const DrirlisEpisode2 = () => {

    return (
       <div>
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/oQaUlvYebLA' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
       <div>
        <Carddirilis />
       </div>
       </div>
     )
   };

   export const DrirlisEpisode3 = () => {

    return (
       <div>
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/eR3rI1jlxvM' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
       <div>
        <Carddirilis />
       </div>
       </div>
     )
   };

   export const DrirlisEpisode4 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/VjC0fS7wYME' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
     )
   };
   
   
   export const DrirlisEpisode5 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/n0urSlRGRbQ' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
     )
   }

   export const DrirlisEpisode6 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/MzOwXxyagQ8' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
     )
   }
   export const DrirlisEpisode7 = () => {

    return (
       <div>
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/llNMOATVdp8' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
       <div>
        <Carddirilis />
       </div>
       </div>
     )
   }

   export const DrirlisEpisode8 = () => {

    return (
       
       <div className='videocop'>
           <ReactPlayer url='https://youtu.be/vZuGxAws-b0' controls playing={true} muted width="1080px" height="720px" onEnded
           />
       </div>
     )
   }
